import React from 'react';
import './App.css';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <h1>Secure File Vault</h1>
        <p>Select an action:</p>
        <button>Register</button>
        <button>Login</button>
      </header>
    </div>
  );
}

export default App;
